import React from 'react';

const Car = ({ children, color, year }) => {

    const colorInfo = color ? (color) : ('Neant');

    if (children) {
        return (<div style={{ 
            background: 'pink', width: '400px', padding: '10px', margin: "5px auto" }}><p> Marque: {children} </p> <p> Couleur: {colorInfo} </p>  <p> Age: {year} </p> </div >
);
    }else {
        return null;
    }

}

export default Car;
